DECLARE @tempZipCodesTable TABLE(
id INT,
zipc NVARCHAR(10),
city NVARCHAR(150),
type INT
)

SET IDENTITY_INSERT [dbo].[ZipCode] ON;

INSERT INTO @tempZipCodesTable
SELECT
    x.value('(@id)', 'INT'),
    x.value('(@zipc)', 'NVARCHAR(10)'),
    x.value('(@city)', 'NVARCHAR(150)'),
    x.value('(@type)', 'INT')
FROM @xml.nodes('value') AS t(x)

MERGE INTO [dbo].[ZipCode]  AS Target
using (
select id,zipc,city, type from @tempZipCodesTable)
AS Source (id, zipc, city,type)
ON Target.ZipCodeId = Source.id
-- update matched rows
WHEN MATCHED THEN
UPDATE
    SET Code = Source.zipc,
        City = Source.city,
		VoivodeshipId = source.type
-- insert new rows
WHEN NOT MATCHED BY TARGET THEN
INSERT (ZipCodeId, Code, City,VoivodeshipId)
VALUES (id,zipc,city,type)
-- delete rows that are in the target but not the source
WHEN NOT MATCHED BY SOURCE THEN
DELETE;

SET IDENTITY_INSERT [dbo].[ZipCode] OFF;
end
